import React from 'react';

import './styles/global.css';

interface TitleProps {
  text: string
};

function Title(props: TitleProps) {
  return (
    <h1>{props.text}</h1>
  );
}

function App() {
  return (
    <div className="App">
      <Title text="Opa"/>
      <Title text="Opa1"/>
      <Title text="Opa2"/>
    </div>
  );
}

export default App;
